import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Navbar from "./modules/Navbar/Navbar";
import Employee from "./modules/Employee/container/Employee";
import About from "./modules/About/container/About";
import Recipe from "./modules/Recipe/Recipe";
import { Contact, GoogleMap } from "./modules/Contact/Contact"; // Import the components from their respective files

const Router = () => {
  return (
    <BrowserRouter>
      <Navbar />
      <Routes>
        <Route path="/employee" element={<Employee />} />
        <Route path="/contact" element={<Contact />} /> {/* Use the Contact component */}
        <Route path="/about" element={<About />} />
        <Route path="/recipe" element={<Recipe />} />
        <Route path="/google-map" element={<GoogleMap />} /> {/* Use the GoogleMap component */}
      </Routes>
      {/* <Footer /> */}
    </BrowserRouter>
  );
};

export default Router;
